
public class TwoDimentionalArray {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int d[][]= {
				
				{2,4,5},
				{5,6,8},
				{7,9,10}
		};
		
		for(int i=0;i<=2;i++) {
			
			for(int j=0;j<=2;j++) {
				System.out.print(" " +d[i][j]);
			}
			System.out.println();
		}
		
	}
	

	}


